    "2016-02-26T18:39:43.486883",nt"name": "nist-database-of-cross-sections-for-inner-shell-ionization-by-electron-or-positron-impact-",nt"isopen":
    true,nt"url": null,nt"notes": "This database provides cross sections for
    ionization of the K shell and of the L and M subshells of neutral atoms of the elements,
    from hydrogen to einsteinium, by electron and positron impact. These cross sections
    are available for projectile kinetic energies that extend from the ionization threshold
    (the binding energy of the active shell) up to 1 GeV. A Java graphical user interface
    (GUI) is provided to visualize the inner-shell ionization cross sections for a selected
    element as a function of projectile energy. This GUI is also used to visualize derived
    quantities (vacancy-production cross sections, Auger and x-ray emission cross sections)
    and to export cross-section tables as formatted ASCII files. This can be run on
    any computer with the Java Runtime Environment (JRE) installed. This software is
    available for free download at http://www.java.com. This product is free but must
    be downloaded after filling in a form at : https://www-s.nist.gov/srd_online/index.cfm?fuseaction=home.main&productID=SRD164v1.0",nt"license_title":
